3n de cambiar el producto, y poner a disposici\\u00f3n de TALLON el o los productos adquiridos. Los productos deber\\u00e1n estar en el mismo estado en que fueron recibidos por el usuario, sin haber sido utilizados por \\u00e9ste, y con el embalaje original, excepto en el caso de falla de producto. \\n\\nAsimismo, si el o los productos no hubieren sufrido roturas o deterioros en tr\\u00e1nsito, o fueren despachados equivocadamente el usuario deber\\u00e1 comunicarse con el centro de atenci\\u00f3n al cliente de TALLON dentro del plazo antes mencionado, \\n\\na efectos de que TALLON proceda, seg\\u00fan corresponda, a gestionar nuevamente el despacho de la compra o bien al retiro de la mercader\\u00eda. En el supuesto de los productos que hayan sufrido roturas o deterioros en tr\\u00e1nsito, estos no deben haber sido utilizados por el usuario, y deben encontrarse en las mismas condiciones en que fueron recibidos, con sus embalajes y etiquetas.","original_price":0,"sale_price":0,"seller_custom_field":"MLA415193-0000","meta_keywords":null,"iva":null,"listing_type":null,"money":"\\"ARS\\"","status_id":1,"priority_id":10,"attributes":null,"published_meli":true,"published_here":true,"gender_id":null,"type_shoes_id":null,"material_id":null,"season_id":null,"search_by":" Botinetas Texanas Mujer - No Ofertar - Test MLA795096559","updated_at":"2021-04-20 20:25:49","created_at":"2021-04-20 20:25:49","id":101}',
